export default function Heatup(props) {
    let heatupArray = [{name: 'Neck', img}, 'Hands']

    useEffect(() => {
        props.setHeatup(heatupArray[0])
    }, [props.next]);

    return (
        <>
            <div className="imgContainer">
                <img src={heatupArray[0]} alt='neck'></img>
            </div>
        </>
